  \"2015-08-21T22:48:03.923653\",\n\t\"name\": \"snap-policy-database\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The SNAP Policy Database provides a central
  data source for information on State policy options in the Supplemental Nutrition
  Assistance Program (SNAP). The database includes information on State-level SNAP
  policies relating to eligibility criteria, recertification and reporting requirements,
  benefit issuance methods, availability of online applications, use of biometric
  technology (such as fingerprinting), and coordination with other low-income assistance
  programs. Data are provided for all 50 States and the District of Columbia for each
  month from January 1996 through December 2011.rn rnThe information in this database
  can facilitate research on factors that influence SNAP participation and on SNAP's
  effects on a variety of outcomes, such as health and dietary intake. More specifically,
  the database can be used to:rnrn- Describe the differences in the State-level administration
  of SNAP and trends in the adoption of specific State-level SNAP policies,rn- Examine
  how State policies affect household-level participation in SNAP, andrn- Estimate
  the effect of SNAP participation on outcomes such as health and food spending by
  combining this data with nationally representative survey data. The SNAP Policy
  Database provides a potentially exogenous source of variation in program participation
  and can be used in instrumental variables estimation techniques.\",\n\t\"license_title\":
